import testSketch from './animation/testSketch'

class NavBar extends Component {



  render(){

    return(
      <div className="">
        Copyright: 2020
        <div className="position-fixed" Style="margin: auto 0; left:0%;">
            <P5Wrapper sketch={testSketch} />
          </div>
      </div>


    )
  }
}
export default NavBar;
